import React from 'react';
import { Navbar } from 'react-bootstrap';

const NavBar = () => {
  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand href="#" className='ml-8 '>
        <img
          src="../ww_logo.png"
          width="273"
          height="90"
          className="d-inline-block align-top"
          alt="Logo"
        />
      </Navbar.Brand>
    </Navbar>
  );
};

export default NavBar;
